import classes from './Input.module.css';
import React from 'react';

function Input(props){

    return(
        <div className={props.className}>
            <label className='input-label' htmlFor={props.id}>{props.title}</label>
            <input placeholder={props.placeholder} step={props.step} onFocus={props.onFocus} onChange={props.onChange} name={props.name} className={props.className} id={props.id} borrow={props.borrow} value={props.value} type={props.type}></input>
        </div>
    )
}

export default Input;
